'use strict';

function GeoCtrl($scope, $ionicModal, uiGmapGoogleMapApi, $cordovaGeolocation, $ionicPopup) {

  var vm = this;
  var posOptions = {timeout: 10000, enableHighAccuracy: true};

  // An alert dialog
  vm.showAlert = function() {
    var alertPopup = $ionicPopup.alert({
      title: 'Localização',
      template: 'Não foi possível recuperar sua posição atual'
    });
    alertPopup.then(function(res) {
      //TODO: chamar um intent da localizacao
    });
  };

  vm.getCurrentPosition = function() {
    uiGmapGoogleMapApi.then(function(map){
      $cordovaGeolocation
        .getCurrentPosition(posOptions)
        .then(function (position) {
          var lat  = position.coords.latitude
          var lng = position.coords.longitude

          vm.map = { center: {
            latitude: lat,
            longitude: lng
          },
            zoom: 16
          };
        }, function(err) {
          $cordovaDialogs.alert("Não foi possível recuperar sua posição", "Localização", "Ok");
        });
    });
  };

  uiGmapGoogleMapApi.then(function(maps) {
    vm.map = {
      center: { latitude: 0, longitude: 0 },
      options: {
        zoomControl: false,
        streetViewControl: false,
        mapTypeControl: false
      },
      zoom: 8
    };

    $cordovaGeolocation
      .getCurrentPosition(posOptions)
      .then(function (position) {
        var lat  = position.coords.latitude
        var lng = position.coords.longitude

        vm.map = { center: {
          latitude: lat,
          longitude: lng
        },
          zoom: 16
        };
      }, function(err) {
        $cordovaDialogs.alert("Não foi possível recuperar sua posição", "Localização", "Ok");
      });
  });


  // modal

  // Form data for the login modal
  $scope.loginData = {};

  // Create the login modal that we will use later
  $ionicModal.fromTemplateUrl('templates/confirmacao.html', {
    scope: $scope,
    animation: 'slide-in-up'
  }).then(function(modal) {
    $scope.modal = modal;
  });

  // Triggered in the login modal to close it
  $scope.closeLogin = function() {
    $scope.modal.hide();
  };

  // Open the login modal
  $scope.login = function() {
    $scope.modal.show();
  };

  // Perform the login action when the user submits the login form
  $scope.doLogin = function() {
    console.log('Doing login', $scope.loginData);
  };

}

