'use strict';

function SigninService($q, $http, API_HOST) {

  var service = {};

  service.post = function(user) {
    var deferred = $q.defer();

    var req = {
      method: 'POST',
      url: API_HOST + '/users/authenticate',
      headers: {
        'X-Auth-Username': user.username,
        'X-Auth-Password': user.password
      }
    }

    $http(req)
      .success(function(data) {
        deferred.resolve(data);
      }).error(function(err, status) {
        deferred.reject(err, status);
      });

    return deferred.promise;
  };

  return service;

}

angular.module('starter.services')
  .service('SigninService', ['$q', '$http', 'API_HOST', SigninService]);

'use strict';

function SignupService($q, $http, API_HOST) {

  var service = {};

  service.post = function(user) {
    var deferred = $q.defer();

    $http.post(API_HOST + '/users', user)
      .success(function(data) {
        deferred.resolve(data);
      }).error(function(err, status) {
        deferred.reject(err, status);
      });

    return deferred.promise;
  };

  return service;

}

angular.module('starter.services')
  .service('SignupService', ['$q', '$http', 'API_HOST', SignupService]);

'use strict';

angular.module('starter')
  .factory('TokenStorage', function() {
  var storageKey = 'auth_token';
  return {
    store : function(token) {
      return localStorage.setItem(storageKey, token);
    },
    retrieve : function() {
      return localStorage.getItem(storageKey);
    },
    clear : function() {
      return localStorage.removeItem(storageKey);
    }
  };

})
  .factory('TokenAuthInterceptor', ['$q', 'TokenStorage', function($q, TokenStorage) {
  return {
    request: function(config) {
      var authToken = TokenStorage.retrieve();
      if (authToken) {
        config.headers['X-Auth-Token'] = authToken;
      }
      return config;
    },
    responseError: function(error) {
      if (error.status === 401 || error.status === 403) {
        TokenStorage.clear();
      }
      return $q.reject(error);
    }
  };
}]).config(function($httpProvider) {
  $httpProvider.interceptors.push('TokenAuthInterceptor');
});
